import React from "react";
import { BrowserRouter as Router } from 'react-router-dom';
import Login from "./components/Signin";

const App = () => (
  <Router>
    <div>
      <Switch>
        <Login />
      </Switch>
    </div>
  </Router>
);

export default App;
